const jsondatastr2 = JSON.stringify(jsondata2)
const topmusics = JSON.parse(jsondatastr2)
let sectiontopmusics = document.getElementById("section-topmusics")
let numberoftrack2 = 0

while(numberoftrack2 < jsondata2[0].tracks.length) {
    let article = document.createElement("article")
    let p = document.createElement("p")
    let img = document.createElement("img")
    sectiontopmusics.insertAdjacentElement("beforeend", article)
    article.insertAdjacentElement("beforeend", img)
    article.insertAdjacentElement("beforeend", p)
    img.classList.add('article__img')
    img.src = topmusics[0].tracks[numberoftrack2].images.background
    article.classList.add('section__article')
    p.textContent = topmusics[0].tracks[numberoftrack2].title;
    p.classList.add('article__p')
    numberoftrack2 = numberoftrack2 + 1
}